import React from 'react';
import './Navbar.css';

const Navbar = () => {
  return (
    <nav className="navbar">
      <div className="navbar-brand">Kanban Board App</div>
      <div className="navbar-dropdown">
        {/* Add dropdown menu content here */}
      </div>
    </nav>
  );
};

export default Navbar;
